// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Token {
    mapping(address => uint256) balances;

    string public name = "Basic Token";
    string public symbol = "BT";

    uint256 public totalSupply = 10000000000 ether;

    address public owner;

    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    constructor() {
        balances[msg.sender] = totalSupply;
        owner = msg.sender;
    }

    function balanceOf(address _addr) external view returns (uint256) {
        return balances[_addr];
    }

    function transfer(address _to, uint256 _amt) external sufficientGuard(_to, _amt) {
        balances[msg.sender] -= _amt;
        balances[_to] += _amt;

        emit Transfer(msg.sender, _to, _amt);
    }

    modifier sufficientGuard (address _addr, uint _amt) {
        require(balances[_addr] > _amt, "Insufficent balance");
        _;
    }
}
